import React, { useState } from "react";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import "../../styles/index.css";

import { useNavigate } from "react-router-dom";

const CustomNavbar = () => {
  const navigate = useNavigate();

  const [selected, setSelected] = useState(1);

  const selectedClass = "btn btn-primary";
  const notSelected = "btn btn-secondary";

  const onButtonPress = (path, num) => {
    setSelected(num);
    navigate(path);
  };
  return (
    <Navbar collapseOnSelect expand="md" bg="dark" variant="dark">
      <Navbar.Brand style={{ cursor: "pointer" }} className="px-5">
        Lightweight Blockchain
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="ml-auto">
          <button
            className={selected === 1 ? `${selectedClass} px-5` : notSelected}
            value="Payload List"
            onClick={() => onButtonPress("/payloadlist", 1)}
          >
            Payload List
          </button>

          <button
            className={selected === 2 ? `${selectedClass} px-5` : notSelected}
            value="Writer List"
            onClick={() => onButtonPress("/writerlist", 2)}
          >
            Writer List
          </button>

          <button
            className={selected === 3 ? `${selectedClass} px-5` : notSelected}
            value="Block List"
            onClick={() => onButtonPress("/blocklist", 3)}
          >
            Block List
          </button>

          <button
            className={selected === 4 ? `${selectedClass} px-5` : notSelected}
            value="Node System"
            onClick={() => onButtonPress("/nodesystem", 4)}
          >
            Node System
          </button>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default CustomNavbar;
